    function KKK (base64String, maxLength, quality) {
    console.log('sdfsdfsdfsd'+base64String.length);
    let imgWidth,
        imgHeight;
    const mine = 'image/jpeg',
          newImage = new Image();
    // onload异步处理
    newImage.src = base64String;
    return new Promise(resolve => {
      newImage.onload = function() {
        imgWidth = newImage.width;
        imgHeight = newImage.height;
        const canvas = document.createElement('canvas'),
          ctx = canvas.getContext('2d');
        if (Math.max(imgWidth, imgHeight) > maxLength) {
          if (imgWidth > imgHeight) {
            canvas.width = maxLength;
            canvas.height = maxLength * imgHeight / imgWidth;
          } else {
            canvas.height = maxLength;
            canvas.width = maxLength * imgWidth / imgHeight;
          }
        } else {
          canvas.width = imgWidth;
          canvas.height = imgHeight;
        }
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        ctx.drawImage(newImage, 0, 0, canvas.width, canvas.height);
        const back = canvas.toDataURL(mine, quality);
        resolve(back);
      };
    });
